import axios from "axios"

const BASE_URL = "http://localhost:8080/users";

function getUsuarios(){
    return axios.get(BASE_URL);
}

function eliminarPorId(id){

return axios.delete(`${BASE_URL}/${id}`);

}


export {getUsuarios, eliminarPorId};
